import React from 'react';

function Copyright(){
    return(
        <footer class="footer">
            <div class="copyright-section">
                <div class="container">
                    <div class="row">
                        <div class="col-md-12">
                            <div className="text-center">
                                <p>Made with <i className="fa fa-heart"></i> and <i className="fa fa-beer"></i>. Thanks <a href="https://uicookies.com/" target="_blank" rel="noopener noreferrer">uiCookies</a> for inspiration</p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </footer>
    );
}

export default Copyright;
